import React, {memo} from 'react';
import "./style.scss"

const ReactCounterChild = (props) => {
    console.log('Child is rendering!')
    const {counter} = props;

    return (
        <div className="counterChild">
            <h2>Child - {counter} </h2>
        </div>
    )
}

export default memo(ReactCounterChild);
